describe('SalesInvoiceLineService', () => {
  let service: SalesInvoiceLineService;

  beforeAll(async () => {
    const app = await Test.createTestingModule({
      providers: [
        SalesInvoiceLineService,
        mockTaxServiceProvider,
        mockProductServiceProvider,
        mockSalesInvoiceServiceProvider,
        saveArgsValidationServiceProvider,
        mockCustomerPriceListServiceProvider,
      ],
    }).compile();

    service = app.get<SalesInvoiceLineService>(SalesInvoiceLineService);
  });

  it('line price is taken from the linePrice field (no calculation yet)', async () => {
    const line = await service.save(
      mockEntityManager,
      {
        narration: '',
        linePrice: 2 * QUANTITY,
        invoice,
        lineOrder: 0,
        quantity: QUANTITY,
        lineTax: {} as any,
        product: product1,
      },
      { id: 1 } as UserModel,
    );
    expect(line.linePrice).toBe(2 * QUANTITY);
  });

  it('line price is taken from the customer group price list if that exists', async () => {
    customerPriceListModel.validTo = null;
    customerPriceListModel.validFrom = null;
    const line = await service.save(
      mockEntityManager,
      {
        narration: '',
        linePrice: 2 * QUANTITY,
        invoice,
        lineOrder: 0,
        quantity: QUANTITY,
        lineTax: {} as any,
        product: product2,
      },
      { id: 1 } as UserModel,
    );
    expect(line.linePrice).toBe(PRODUCT_GROUP_PRICE * QUANTITY);
  });

  it('line price is taken from the customer group price list if that exists and is valid', async () => {
    customerPriceListModel.validTo = null;
    customerPriceListModel.validFrom = moment()
      .add(1, 'days')
      .toDate();
    const line = await service.save(
      mockEntityManager,
      {
        narration: '',
        linePrice: 2 * QUANTITY,
        invoice,
        lineOrder: 0,
        quantity: QUANTITY,
        lineTax: {} as any,
        product: product2,
      },
      { id: 1 } as UserModel,
    );
    expect(line.linePrice).not.toBe(PRODUCT_GROUP_PRICE * QUANTITY);
  });

  it('line price is taken from the customer group price list that is with the newest start', async () => {
    customerPriceListModel.validTo = null;
    customerPriceListModel.validFrom = null;
    const customerPriceListModel2: CustomerPriceListModel = _.cloneDeep(
      customerPriceListModel,
    );
    customerPriceListModel2.validFrom = moment()
      .add(-1, 'days')
      .toDate();
    customerPriceListModel2.productPrices[0].sellingPrice =
      PRODUCT_GROUP_PRICE / 2;
    const remember =
      mockCustomerPriceListService.loadDateValidByCustomerGroupAndProduct;
    mockCustomerPriceListService.loadDateValidByCustomerGroupAndProduct = (
      transactionalEntityManager,
      customerGroup,
      product,
    ): CustomerPriceListModel[] | null =>
      product === product2 && customerGroup === customerGroup1
        ? [customerPriceListModel, customerPriceListModel2]
        : null;
    try {
      const line = await service.save(
        mockEntityManager,
        {
          narration: '',
          linePrice: 2 * QUANTITY,
          invoice,
          lineOrder: 0,
          quantity: QUANTITY,
          lineTax: {} as any,
          product: product2,
        },
        { id: 1 } as UserModel,
      );
      expect(line.linePrice).toBe((PRODUCT_GROUP_PRICE / 2) * QUANTITY);
    } finally {
      mockCustomerPriceListService.loadDateValidByCustomerGroupAndProduct = remember;
    }
  });
});

